    angle_degrees = math.degrees(angle)
    if angle_degrees < -90:
        angle_degrees = -90
    elif angle_degrees > 90:
        angle_degrees = 90
    if angle < -0.1:
        differential = 89.1 * angle_degrees + 43.7
    elif angle > 1:
        differential = 126 * angle_degrees - 28.9
    else:
        differential = 0
    return (angle_degrees, differential)

